INSERT INTO `cs_questions` (`no`, `qno`, `member_uid`, `cateCode`, `subcateCode`, `title`, `content`, `view`, `file`, `regip`, `rdate`, `answer`) VALUES
	(62, 0, 'et009153', 3, 10, '비밀번호는 찾을 수 없나요?', '<p>재설정 옵션밖에 없네요</p>', 0, 0, '127.0.0.1', '2023-03-17 00:36:58', 0),
	(63, 0, 'admin', 3, 10, '아이디는 어떻게 찾나요?', '<p>아이디를 잊어버렸습니다</p>', 0, 0, '127.0.0.1', '2023-03-17 00:39:13', 0),
	(64, 0, 'admin', 3, 10, '회원 탈퇴하고 싶은데요', '<p>탈퇴는 어디서 하나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 00:39:58', 0),
	(65, 0, 'admin', 3, 10, '제가 쓴 병원 리뷰를 수정할 수 있나요?', '<p>별점을 다시 주고 싶은데 어떻게 수정하나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 00:41:24', 0),
	(66, 0, 'admin', 3, 10, '제가 쓴 병원 리뷰를 삭제하고 싶은데요', '<p>삭제는 어디서 하나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 00:41:58', 0),
	(67, 0, 'admin', 3, 10, '제가 방문한 병원을 표시하고 싶은데 어떻게 하나요?', '<p>어디로 가서 표시하면 되나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 00:43:43', 0),
	(68, 0, 'admin', 3, 10, '회원 등급이 따로 있나요?', '<p>등업하면 좋은 점이 있나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 00:44:20', 0),
	(69, 0, 'admin', 3, 10, '로그인이 됐다가 안됐다가 해요', '<p>로그인될 때 얼른 문의 남겨봅니다</p><p>이거 왜 이런 거죠?</p>', 0, 0, '127.0.0.1', '2023-03-17 00:46:57', 0),
	(70, 0, 'admin', 3, 10, '회원 탈퇴 후 제 정보는 자동 삭제되나요?', '<p>보관하지말고 바로 지워주세요</p>', 0, 0, '127.0.0.1', '2023-03-17 00:47:38', 0),
	(71, 0, 'admin', 3, 10, '의사 회원인데 왜 제 면허증 승인을 안해주십니까', '<p>해주셔야 제가 커뮤니티에 답변글도 달 수 있는데 빨리 승인해주세요</p>', 0, 0, '127.0.0.1', '2023-03-17 00:53:05', 0),
	(72, 0, 'admin', 3, 10, '제 회원 정보는 어디서 볼 수 있나요?', '<p>어디로 가야 하나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 01:19:52', 0),
	(76, 0, 'admin', 3, 10, '비밀번호는 찾을 수 없나요?', '<p>까먹었어요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:29:29', 0),
	(77, 0, 'admin', 3, 10, '아이디를 까먹었는데 어떻게 찾나요?', '<p>잊어버렸어요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:29:47', 0),
	(78, 0, 'admin', 3, 10, '회원 탈퇴하고 싶은데요', '<p>탈퇴 버튼이 어디있죠?</p>', 0, 0, '127.0.0.1', '2023-03-17 01:30:05', 0),
	(79, 0, 'admin', 3, 10, '제가 쓴 병원 리뷰를 수정할 수 있나요?', '<p>별점을 수정하고 싶은데요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:30:25', 0),
	(80, 0, 'admin', 3, 10, '제가 쓴 병원 리뷰를 삭제하고 싶은데요', '<p>어떻게 하나요?</p>', 0, 0, '127.0.0.1', '2023-03-17 01:30:40', 0),
	(81, 0, 'admin', 3, 10, '의사 회원 면허증 첨부는 몇 개 까지 가능한가요?', '<p>이 두 파일을 첨부하고 싶은데 하나만 가능한가요?</p>', 0, 0, '127.0.0.1', '2023-03-17 01:33:09', 0),
	(82, 0, 'admin', 3, 10, '네이버로 로그인해도 자동 로그인이 되나요?', '<p>자동 로그인 하고 싶어요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:35:33', 0),
	(83, 0, 'admin', 3, 10, '구글 로그인은 안되나요?', '<p>안된다면 되게 해주세요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:44:13', 0),
	(84, 0, 'admin', 3, 10, '계정을 여러 개 만들어도 되나요?', '<p>그냥 궁금해서 여쭤봅니다</p>', 0, 0, '127.0.0.1', '2023-03-17 01:50:44', 0),
	(85, 0, 'admin', 3, 10, '닉네임은 변경 가능한가요?', '<p>닉네임 바꾸고 싶어요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:52:23', 0),
	(86, 0, 'admin', 3, 20, '제가 검색하고 싶은 증상이 없어요', '<p>업데이트 좀 해주세요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:54:55', 0),
	(87, 0, 'admin', 3, 30, '응급실 상세 페이지에 리뷰는 어디서 쓰는 건가요?', '<p>저도 쓰고 싶은데 안보여서요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:55:58', 0),
	(88, 0, 'admin', 3, 40, '혹시 커뮤니티에 글 도배하는 회원 차단할 수 있나요?', '<p>제가 차단못하면 계정 정지라도 시켜주세요</p>', 0, 0, '127.0.0.1', '2023-03-17 01:56:41', 0),
	(89, 0, 'admin', 3, 50, '서비스 이름의 유래가 어떻게 되나요?', '<p>swiftER이라는 단어가 어떻게 나온 건지 궁금합니다</p><br>', 0, 0, '127.0.0.1', '2023-03-17 01:57:31', 0),
	(91, 0, 'admin', 2, 10, '비밀번호는 어떻게 찾나요?', '사용자의 회원가입 시 비밀번호는 암호화되어 데이터베이스에 저장되므로 관리자도 사용자의 비밀번호를 알 수 없습니다. 따라서 비밀번호를 찾으실 수는 없고, 재설정하셔야 합니다. 비밀번호 재설정은 로그인 > 비밀번호 재설정 또는 마이페이지 > 비밀번호 재설정에서 가능합니다', 0, 0, '127.0.0.1', '2023-03-20 10:01:10', 0),
	(92, 0, 'admin', 2, 10, '아이디는 어떻게 찾나요?', '로그인 > 아이디찾기에서 아이디를 찾으실 수 있습니다', 0, 0, '127.0.0.1', '2023-03-20 10:18:52', 0),
	(93, 0, 'admin', 2, 10, '회원 탈퇴는 어떻게 하나요?', '마이페이지 > 탈퇴하기에서 탈퇴를 진행해주세요', 0, 0, '127.0.0.1', '2023-03-20 12:03:22', 0),
	(94, 0, 'admin', 1, 10, 'swiftER 사이트 리뉴얼 안내', '저희 swiftER 사이트가 새단장할 예정입니다. 업데이트 기간 동안 서비스 이용에 차질이 생길 수 있어 이 점 양해부탁드립니다. 감사합니다', 5, 0, '127.0.0.1', '2023-03-20 12:54:44', 0),
	(95, 0, 'admin', 1, 10, '사이트 정기 점검 안내', '보다 원활한 서비스 이용을 위하여 정기 점검을 시행할 예정입니다. 하기 시간 동안 서비스 이용에 제한이 있을 수 있으니 참고 바랍니다\r\n점검 일시\r\n2023.03.21 23:30 - 2023.03.22 04:00', 7, 0, '127.0.0.1', '2023-03-21 09:23:57', 0),
	(96, 0, 'admin', 1, 20, '증상 업데이트 안내', '더욱 상세한 증상 검색이 가능하도록 증상 데이터베이스를 업데이트 할 예정입니다. 이용에 참고 부탁드립니다', 3, 0, '127.0.07', '2023-03-21 09:26:12', 0),
	(98, 0, 'admin', 1, 30, '응급실 검색 서비스 긴급 점검', '전국 응급실 정보를 제공하는 허브 고장으로 swiftER도 긴급 점검에 들어갑니다. 점검이 끝나면 다시 공지해드리겠습니다', 4, 0, '127.0.0.1', '2023-03-21 09:34:32', 0),
	(99, 0, 'admin', 1, 40, '커뮤니티 우리 동네 게시판 이벤트 안내', '각 지역별 게시판마다 가장 유용한 글을 뽑아서 경품을 드릴 예정입니다. 많은 참여 부탁드립니다. 비속어 사용, 타인 비방 등의 이유로 채택이 취소될 수 있다는 점 유의바랍니다.', 17, 0, '127.0.0.1', '2023-03-21 09:37:35', 0),
	(100, 0, 'admin', 1, 50, '여러분의 소리를 들려주세요', '여러분의 피드백은 swiftER의 발전에 큰 도움이 됩니다. 피드백을 바탕으로 더욱 편리하고 유용한 서비스를 제공하는 swiftER이 되겠습니다', 9, 0, '127.0.0.7', '2023-03-21 09:39:37', 0),
	(102, 0, 'admin', 1, 10, '사이트 정기 점검 안내', '보다 원활한 서비스 이용을 위하여 정기 점검을 시행할 예정입니다. 하기 시간 동안 서비스 이용에 제한이 있을 수 있으니 참고 바랍니다\r\n점검 일시\r\n2023.03.21 23:30 - 2023.03.22 04:00', 11, 0, '127.0.0.1', '2023-03-21 09:23:57', 0),
	(104, 0, 'admin', 1, 30, '응급실 검색 서비스 긴급 점검', '전국 응급실 정보를 제공하는 허브 고장으로 swiftER도 긴급 점검에 들어갑니다. 점검이 끝나면 다시 공지해드리겠습니다', 16, 0, '127.0.0.1', '2023-03-21 09:34:32', 0),
	(105, 0, 'admin', 1, 40, '커뮤니티 우리 동네 게시판 이벤트 안내', '<p>각 지역별 게시판마다 가장 유용한 글을 뽑아서 경품을 드릴 예정입니다. 많은 참여 부탁드립니다. 비속어 사용, 타인 비방 등의 이유로 채택이 취소될 수 있다는 점 유의바랍니다.</p>', 20, 0, '127.0.0.1', '2023-03-29 16:27:00', 0),
	(106, 0, 'admin', 1, 50, '여러분의 소리를 들려주세요', '<p>여러분의 피드백은 swiftER의 발전에 큰 도움이 됩니다. 피드백을 바탕으로 더욱 편리하고 유용한 서비스를 제공하는 swiftER이 되겠습니다</p>', 29, 0, '127.0.0.1', '2023-03-29 16:29:03', 0),
	(108, 0, 'et009153', 3, 50, '파일 첨부가 안되는데 왜 그런 겁니까', '<p>글만 쓰면 잘 올라가는데 파일까지 첨부하면 계속 오류가 뜨네요. 어떻게 해야하나요?</p>', 0, 0, '127.0.0.1', '2023-03-24 03:12:25', 0),
	(109, 0, 'et009153', 3, 10, '글이 안올라가는데요', '<p>&lt;script&gt;alert(\'boo\');&lt;/script&gt;</p>', 0, 0, '127.0.0.1', '2023-03-24 03:13:03', 0),
	(111, 0, 'et009153', 3, 10, '일반 회원에서 의사 회원으로 전환하고 싶은데요', '<p>최근 의사 면허를 취득해서 이제 의사 회원으로 활동하고 싶습니다. 일단 인증을 위해서 면허증 사진도 첨부했는데 어떻게 해야 하나요?</p>', 0, 0, '127.0.0.1', '2023-03-24 04:12:25', 0),
	(118, 0, 'et009153', 1, 40, '테스트입니다', '<p><strong>테스트</strong>입니다</p>', 54, 0, '127.0.0.1', '2023-03-29 16:54:35', 0),
	(121, 0, 'et009153', 3, 50, '문의하기 파일 다운로드가 안되는데요', '<p>빨리 고쳐주세요</p>', 0, 1, '61.34.107.92', '2023-03-30 02:01:08', 0),
	(122, 0, 'admin', 2, 40, '질문 게시판에 답변은 언제 달리나요?', '질문 게시판의 질문에 대해서는 의사 회원님들만 답변이 가능합니다. 의사 회원님들이 답변을 달아주실 때까지 기다려주세요', 0, 0, '127.0.0.1', '2023-03-30 12:54:11', 0),
	(123, 0, 'et009153', 3, 50, '문의하기 테스트입니다', '<p>다중 파일 첨부 및 에디터 테스트</p>', 0, 3, '61.34.107.92', '2023-03-31 00:31:43', 1),
	(127, 123, 'et009153', 3, 50, '문의하기 테스트입니다', '<p>:&lt;행운을 가져다 주는 테스트입니다</p>', 0, 4, '127.0.0.1', '2023-04-03 16:55:16', 0),
	(148, 0, 'et009153', 2, 20, 'faq modify 테스트용입니다', '<p><strong>test&nbsp;</strong><u>test</u></p>', 0, 2, '127.0.0.1', '2023-04-05 15:43:20', 0),
	(150, 0, 'et009153', 2, 50, 'rdate 테스트입니다', '<p>DB에 rdate값 어떻게 저장되는 지 확인하기 위한 테스트입니다</p>', 0, 0, '127.0.0.1', '2023-04-07 04:14:24', 0);
