	('\r\n\r\n제 1 장 총 칙\r\n\r\n \r\n\r\n제 1 조 (목적)\r\n이 약관은 swiftER(이하 "사이트"라 합니다)에서 제공하는 인터넷서비스(이하 "서비스"라 합니다)의 이용 조건 및 절차에 관한 기본적인 사항을 규정함을 목적으로 합니다.\r\n\r\n \r\n\r\n제 2 조 (약관의 효력 및 변경)\r\n① 이 약관은 서비스 화면이나 기타의 방법으로 이용고객에게 공지함으로써 효력을 발생합니다.\r\n② 사이트는 이 약관의 내용을 변경할 수 있으며, 변경된 약관은 제1항과 같은 방법으로 공지 또는 통지함으로써 효력을 발생합니다.\r\n\r\n \r\n\r\n제 3 조 (용어의 정의)\r\n이 약관에서 사용하는 용어의 정의는 다음과 같습니다.\r\n① 회원 : 사이트와 서비스 이용계약을 체결하거나 이용자 아이디(ID)를 부여받은 개인 또는 단체를 말합니다.\r\n② 신청자 : 회원가입을 신청하는 개인 또는 단체를 말합니다.\r\n③ 아이디(ID) : 회원의 식별과 서비스 이용을 위하여 회원이 정하고 사이트가 승인하는 문자와 숫자의 조합을 말합니다.\r\n④ 비밀번호 : 회원이 부여 받은 아이디(ID)와 일치된 회원임을 확인하고, 회원 자신의 비밀을 보호하기 위하여 회원이 정한 문자와 숫자의 조합을 말합니다.\r\n⑤ 해지 : 사이트 또는 회원이 서비스 이용계약을 취소하는 것을 말합니다.\r\n\r\n \r\n\r\n제 2 장 서비스 이용계약\r\n\r\n \r\n\r\n제 4 조 (이용계약의 성립)\r\n① 이용약관 하단의 동의 버튼을 누르면 이 약관에 동의하는 것으로 간주됩니다.\r\n② 이용계약은 서비스 이용희망자의 이용약관 동의 후 이용 신청에 대하여 사이트가 승낙함으로써 성립합니다.\r\n\r\n \r\n\r\n제 5 조 (이용신청)\r\n① 신청자가 본 서비스를 이용하기 위해서는 사이트 소정의 가입신청 양식에서 요구하는 이용자 정보를 기록하여 제출해야 합니다.\r\n② 가입신청 양식에 기재하는 모든 이용자 정보는 모두 실제 데이터인 것으로 간주됩니다. 실명이나 실제 정보를 입력하지 않은 사용자는 법적인 보호를 받을 수 없으며, 서비스의 제한을 받을 수 있습니다.\r\n\r\n \r\n\r\n제 6 조 (이용신청의 승낙)\r\n① 사이트는 신청자에 대하여 제2항, 제3항의 경우를 예외로 하여 서비스 이용신청을 승낙합니다.\r\n② 사이트는 다음에 해당하는 경우에 그 신청에 대한 승낙 제한사유가 해소될 때까지 승낙을 유보할 수 있습니다.\r\n가. 서비스 관련 설비에 여유가 없는 경우\r\n나. 기술상 지장이 있는 경우\r\n다. 기타 사이트가 필요하다고 인정되는 경우\r\n③ 사이트는 신청자가 다음에 해당하는 경우에는 승낙을 거부할 수 있습니다.\r\n가. 다른 개인(사이트)의 명의를 사용하여 신청한 경우\r\n나. 이용자 정보를 허위로 기재하여 신청한 경우\r\n다. 사회의 안녕질서 또는 미풍양속을 저해할 목적으로 신청한 경우\r\n라. 기타 사이트 소정의 이용신청요건을 충족하지 못하는 경우\r\n\r\n \r\n\r\n제 7 조 (이용자정보의 변경)\r\n회원은 이용 신청시에 기재했던 회원정보가 변경되었을 경우에는, 온라인으로 수정하여야 하며 변경하지 않음으로 인하여 발생되는 모든 문제의 책임은 회원에게 있습니다.\r\n\r\n \r\n\r\n제 3 장 계약 당사자의 의무\r\n\r\n \r\n\r\n제 8 조 (사이트의 의무)\r\n① 사이트는 회원에게 각 호의 서비스를 제공합니다.\r\n가. 신규서비스와 도메인 정보에 대한 뉴스레터 발송\r\n나. 추가 도메인 등록시 개인정보 자동 입력\r\n다. 도메인 등록, 관리를 위한 각종 부가서비스\r\n② 사이트는 서비스 제공과 관련하여 취득한 회원의 개인정보를 회원의 동의없이 타인에게 누설, 공개 또는 배포할 수 없으며, 서비스관련 업무 이외의 상업적 목적으로 사용할 수 없습니다. 단, 다음 각 호의 1에 해당하는 경우는 예외입니다.\r\n가. 전기통신기본법 등 법률의 규정에 의해 국가기관의 요구가 있는 경우\r\n나. 범죄에 대한 수사상의 목적이 있거나 정보통신윤리 위원회의 요청이 있는 경우\r\n다. 기타 관계법령에서 정한 절차에 따른 요청이 있는 경우\r\n③ 사이트는 이 약관에서 정한 바에 따라 지속적, 안정적으로 서비스를 제공할 의무가 있습니다.\r\n\r\n \r\n\r\n제 9 조 (회원의 의무)\r\n① 회원은 서비스 이용 시 다음 각 호의 행위를 하지 않아야 합니다.\r\n가. 다른 회원의 ID를 부정하게 사용하는 행위\r\n나. 서비스에서 얻은 정보를 사이트의 사전승낙 없이 회원의 이용 이외의 목적으로 복제하거나 이를 변경, 출판 및 방송 등에 사용하거나 타인에게 제공하는 행위\r\n다. 사이트의 저작권, 타인의 저작권 등 기타 권리를 침해하는 행위\r\n라. 공공질서 및 미풍양속에 위반되는 내용의 정보, 문장, 도형 등을 타인에게 유포하는 행위\r\n마. 범죄와 결부된다고 객관적으로 판단되는 행위\r\n바. 기타 관계법령에 위배되는 행위\r\n② 회원은 관계법령, 이 약관에서 규정하는 사항, 서비스 이용 안내 및 주의 사항을 준수하여야 합니다.\r\n③ 회원은 내용별로 사이트가 서비스 공지사항에 게시하거나 별도로 공지한 이용 제한 사항을 준수하여야 합니다.\r\n\r\n \r\n\r\n제 4 장 서비스 제공 및 이용\r\n\r\n \r\n\r\n제 10 조 (회원 아이디(ID)와 비밀번호 관리에 대한 회원의 의무)\r\n① 아이디(ID)와 비밀번호에 대한 모든 관리는 회원에게 책임이 있습니다. 회원에게 부여된 아이디(ID)와 비밀번호의 관리소홀, 부정사용에 의하여 발생하는 모든 결과에 대한 전적인 책임은 회원에게 있습니다.\r\n② 자신의 아이디(ID)가 부정하게 사용된 경우 또는 기타 보안 위반에 대하여, 회원은 반드시 사이트에 그 사실을 통보해야 합니다.\r\n\r\n \r\n\r\n제 11 조 (서비스 제한 및 정지)\r\n① 사이트는 전시, 사변, 천재지변 또는 이에 준하는 국가비상사태가 발생하거나 발생할 우려가 있는 경우와 전기통신사업법에 의한 기간통신 사업자가 전기통신서비스를 중지하는 등 기타 불가항력적 사유가 있는 경우에는 서비스의 전부 또는 일부를 제한하거나 정지할 수 있습니다.\r\n② 사이트는 제1항의 규정에 의하여 서비스의 이용을 제한하거나 정지할 때에는 그 사유 및 제한기간 등을 지체없이 회원에게 알려야 합니다.\r\n\r\n \r\n\r\n제5장 계약사항의 변경, 해지\r\n\r\n \r\n\r\n제 12 조 (정보의 변경)\r\n회원이 주소, 비밀번호 등 고객정보를 변경하고자 하는 경우에는 홈페이지의 회원정보 변경 서비스를 이용하여 변경할 수 있습니다.\r\n\r\n \r\n\r\n제 13 조 (계약사항의 해지)\r\n회원은 서비스 이용계약을 해지할 수 있으며, 해지할 경우에는 본인이 직접 서비스를 통하거나 전화 또는 온라인 등으로 사이트에 해지신청을 하여야 합니다. 사이트는 해지신청이 접수된 당일부터 해당 회원의 서비스 이용을 제한합니다. 사이트는 회원이 다음 각 항의 1에 해당하여 이용계약을 해지하고자 할 경우에는 해지조치 7일전까지 그 뜻을 이용고객에게 통지하여 소명할 기회를 주어야 합니다.\r\n① 이용고객이 이용제한 규정을 위반하거나 그 이용제한 기간 내에 제한 사유를 해소하지 않는 경우\r\n② 정보통신윤리위원회가 이용해지를 요구한 경우\r\n③ 이용고객이 정당한 사유 없이 의견진술에 응하지 아니한 경우\r\n④ 타인 명의로 신청을 하였거나 신청서 내용의 허위 기재 또는 허위서류를 첨부하여 이용계약을 체결한 경우\r\n사이트는 상기 규정에 의하여 해지된 이용고객에 대해서는 별도로 정한 기간동안 가입을 제한할 수 있습니다.\r\n\r\n \r\n\r\n제6장 손해배상\r\n\r\n \r\n\r\n제 14 조 (면책조항)\r\n① 사이트는 회원이 서비스 제공으로부터 기대되는 이익을 얻지 못하였거나 서비스 자료에 대한 취사선택 또는 이용으로 발생하는 손해 등에 대해서는 책임이 면제됩니다.\r\n② 사이트는 회원의 귀책사유나 제3자의 고의로 인하여 서비스에 장애가 발생하거나 회원의 데이터가 훼손된 경우에 책임이 면제됩니다.\r\n③ 사이트는 회원이 게시 또는 전송한 자료의 내용에 대해서는 책임이 면제됩니다.\r\n④ 상표권이 있는 도메인의 경우, 이로 인해 발생할 수도 있는 손해나 배상에 대한 책임은 구매한 회원 당사자에게 있으며, 사이트는 이에 대한 일체의 책임을 지지 않습니다.\r\n\r\n \r\n\r\n제 15 조 (관할법원)\r\n\r\n \r\n\r\n서비스와 관련하여 사이트와 회원간에 분쟁이 발생할 경우 사이트의 본사 소재지를 관할하는 법원을 관할법원으로 합니다.\r\n\r\n \r\n\r\n[부칙]\r\n\r\n \r\n\r\n(시행일) 이 약관은 2023년 03월부터 시행합니다.', '\r\n1 개인정보의 처리 목적\r\n•	① swiftER은(는) 다음의 목적을 위하여 개인정보를 처리하고 있으며, 다음의 목적 이외의 용도로는 이용하지 않습니다.\r\no	고객 가입의사 확인, 고객에 대한 서비스 제공에 따른 본인 식별·인증, 회원자격 유지·관리, 물품 또는 서비스 공급에 따른 금액 결제, 물품 또는 서비스의 공급·배송, 마케팅 및 광고에의 활용\r\n2 개인정보의 처리 및 보유 기간 작성\r\n•	① swiftER은(는) 정보주체로부터 개인정보를 수집할 때 동의 받은 개인정보 보유·이용기간 또는 법령에 따른 개인정보 보유·이용기간 내에서 개인정보를 처리·보유합니다.\r\n•	② 구체적인 개인정보 처리 및 보유 기간은 다음과 같습니다.\r\no	고객 가입 및 관리 : 서비스 이용계약 또는 회원가입 해지시까지, 다만 채권·채무관계 잔존시에는 해당 채권·채무관계 정산시까지\r\no	전자상거래에서의 계약·청약철회, 대금결제, 재화 등 공급기록 : 5년\r\n3 정보주체와 법정대리인의 권리·의무 및 그 행사방법\r\n•	정보주체는 <ㅇㅇㅇ>에 대해 언제든지 다음 각 호의 개인정보 보호 관련 권리를 행사할 수 있습니다.\r\no	1. 개인정보 열람요구\r\no	2. 오류 등이 있을 경우 정정 요구\r\no	3. 삭제요구\r\no	4. 처리정지 요구\r\n4 처리하는 개인정보 항목\r\n•	개인정보 처리업무: 홈페이지 회원가입 및 관리, 민원사무 처리, 재화 또는 서비스 제공, 마케팅 및 광고에의 활용\r\n•	필수항목: 로그인ID, 비밀번호, 서비스 이용 기록, 접속 로그, 쿠키, 접속 IP 정보, 결제기록\r\n•	선택항목: 이메일, 성별, 이름\r\n5 개인정보의 파기\r\n•	파기절차\r\n이용자가 입력한 정보는 목적 달성 후 별도의 DB에 옮겨져(종이의 경우 별도의 서류) 내부 방침 및 기타 관련 법령에 따라 일정기간 저장된 후 혹은 즉시 파기됩니다. 이 때, DB로 옮겨진 개인정보는 법률에 의한 경우가 아니고서는 다른 목적으로 이용되지 않습니다.\r\n•	파기기한\r\n이용자의 개인정보는 개인정보의 보유기간이 경과된 경우에는 보유기간의 종료일로부터 5일 이내에, 개인정보의 처리 목적 달성, 해당 서비스의 폐지, 사업의 종료 등 그 개인정보가 불필요하게 되었을 때에는 개인정보의 처리가 불필요한 것으로 인정되는 날로부터 5일 이내에 그 개인정보를 파기합니다.\r\n6 개인정보 자동 수집 장치의 설치·운영 및 그 거부에 관한 사항\r\n•	① <ㅇㅇㅇ>은 개별적인 맞춤서비스를 제공하기 위해 이용정보를 저장하고 수시로 불러오는 ‘쿠키(cookie)’를 사용합니다.\r\n•	② 쿠키는 웹사이트를 운영하는데 이용되는 서버(http)가 이용자의 컴퓨터 브라우저에게 보내는 소량의 정보이며 이용자들의 컴퓨터 내의 하드디스크에 저장되기도 합니다.\r\no	가. 쿠키의 사용 목적 : 이용자가 방문한 각 서비스와 웹 사이트들에 대한 방문 및 이용형태, 인기 검색어, 보안접속 여부, 등을 파악하여 이용자에게 최적화된 정보 제공을 위해 사용됩니다.\r\no	나. 쿠키의 설치·운영 및 거부 : 웹브라우저 상단의 도구>인터넷 옵션>개인정보 메뉴의 옵션 설정을 통해 쿠키 저장을 거부 할 수 있습니다.\r\no	다. 쿠키 저장을 거부할 경우 맞춤형 서비스 이용에 어려움이 발생할 수 있습니다.\r\n7 개인정보 보호책임자\r\n•	이름: 홍길동\r\n•	소속: 운영팀\r\n•	전화: 02-1234-5678\r\n•	이메일: swiftER@example.com\r\n8 개인정보의 안전성 확보 조치\r\n•	개인정보의 암호화\r\no	이용자의 비밀번호는 암호화 되어 저장 및 관리되고 있어, 본인만이 알 수 있으며 중요한 데이터는 파일 및 전송 데이터를 암호화 하거나 파일 잠금 기능을 사용하는 등의 별도 보안기능을 사용하고 있습니다.\r\n9 개인정보처리방침의 변경\r\n•	이 개인정보처리방침은 시행일로부터 적용되며, 법령 및 방침에 따른 변경내용의 추가, 삭제 및 정정이 있는 경우에는 변경사항의 시행 7일 전부터 공지사항을 통하여 고지할 것입니다.\r\no	공고일자 : 2023년 03월 13일\r\no	시행일자 : 2023년 03월 13일', '\r\n제1조 (목적)\r\n이 약관은 swiftER(이하 “회사”)이 제공하는 “이용자 위치기반 주변매장 찾기”(이하 “서비스”)에 관하여 서비스에 동의한 고객이 서비스를 이용하는 데 필요한 회사와 고객의 권리 및 의무, 기타 제반 사항을 규정함을 목적으로 합니다.\r\n제2조 (정의)\r\n① 이 약관에서 사용하는 용어의 정의는 다음과 같습니다.\r\n1. “이용자 위치기반 주변병원 찾기”서비스: 개인위치정보주체의 모바일 기기로부터 수집한 현 위치 정보를 기반으로 가까운 매장에 관한 정보를 개인위치정보주체에게 무상으로 제공하는 관련 제반 서비스를 말합니다.\r\n2. 사이트: 서비스를 제공하기 위한 컴퓨터 등 정보통신설비를 이용하여 설정한 가상의 영업장을 말하며, 아울러 이를 운영하는 사업자의 의미로도 사용합니다.\r\n3. 회원: 서비스에 동의한 자로서 이 약관에 동의한 자를 말합니다.\r\n4. 비회원: 회원으로 가입하지 않고 회사가 제공하는 서비스를 이용하는 자를 말합니다.\r\n5. 이용자: 회사가 제공하는 본 위치기반서비스에 동의하고 이를 이용하는 회원 및 비회원을 말합니다.\r\n② 위 가.항에서 정의되지 않은 이 약관상의 용어의 의미는 관계법령, 사이트 등의 이용약관 또는 상관례에 의합니다.\r\n제3조 (계약의 체결 및 해지)\r\n① 고객은 회사의 서비스를 이용하고자 하는 경우, 약관의 고지 내용에 따라 위치기반서비스에 가입하게 됩니다. 회원의 경우 회원가입시 동의절차를 밟으며, 비회원인 경우 서비스를 이용하는 동안 이 약관에 동의한 것으로 간주합니다.\r\n② 고객은 계약을 해지하고자 할 때에는 가입 회원탈퇴를 하거나, 회사의 개인정보보호 담당자에게 이메일을 통해 해지신청을 하여야 합니다.\r\n제4조 (약관의 명시와 개정 등)\r\n① 회사는 이 약관을 이용자가 쉽게 알 수 있도록 “이용자 위치기반 주변매장 찾기” 서비스(이하“서비스”라고 합니다)가 제공되는 사이트 등의 초기서비스 화면에 게시합니다. 다만, 약관의 내용은 이용자가 연결화면을 통하여 볼 수 있도록 할 수 있습니다.\r\n② 회사는 “약관의 규제에 관한 법률”, “위치정보의 보호 및 이용 등에 관한 법률” 등 관련법령을 위반하지 않는 범위 내에서 이 약관을 개정할 수 있습니다. 회사가 약관을 개정하는 경우에는 개정된 약관의 적용일자 및 개정사유를 명시하여 현행약관과 함께 가.항의 방법으로 그 적용일자 7일 전부터 적용일자 전일까지 공지합니다. 다만, 이용자의 권리·의무에 중대한 영향을 주는 변경인 경우에는 그 적용일자 30일 전부터 적용일자 전일까지 공지합니다.\r\n③ 회사가 전항에 따라 개정약관을 공지한 경우 이용자가 개정약관 적용일자 이전까지 명시적으로 거부의 의사표시를 하지 않은 경우에는 개정약관에 동의한 것으로 봅니다.\r\n④ 이 약관에서 정하지 아니한 사항이나 해석에 대해서는 별도의 회사 정책, 관계법령 또는 상관례에 의합니다. 이용자는 회사가 제공하는 서비스를 이용함에 있어 관련법령을 모두 준수하여야 하고, 이 약관의 규정을 들어 관련법령 위반에 대한 면책을 주장할 수 없습니다.\r\n제5조 (회사의 정책 및 서비스)\r\n① 회사는 원활한 “서비스 유지 및 이용자의 보호를 위해 별도의 정책 및 내용을 정할 수 있으며, 필요한 경우 이를 변경할 수 있습니다.\r\n② 이용자는 회사가 정한 정책을 확인하고 준수하여야 합니다.\r\n제6조 서비스의 내용 및 이용요금\r\n서비스의 내용	이용요금\r\n주변 매장 찾기\r\n- 현재의 위치를 기반으로 주변 매장의 위치와 정보를 제공하는 서비스\r\n\r\n무료\r\n* 무선서비스 이용 시 발생하는 데이터 통신료는 별도이며, 이용자가 가입한 각 이동통신사의 정책에 따릅니다.\r\n\r\n제7조 개인위치정보의 이용 또는 제공\r\n① 회사는 개인정보위치정보를 이용하여 서비스를 제공하고자 하는 경우에는 본 약관에 대해 개인위치정보주체의 동의를 얻어야 합니다.\r\n② 회사는 타사업자와의 요금정산 및 민원처리를 위해 위치정보 이용ㆍ제공ㆍ사실 확인자료를 자동 기록ㆍ보존하며, 해당 자료는 6개월간 보관합니다.\r\n③ 회사는 개인위치정보주체의 동의 없이 개인위치 정보를 제3자에게 제공하지 아니하며, 제3자에게 개인위치정보를 제공하는 경우 제공 받는 자 및 제공목적을 사전에 개인위치정보주체에게 고지하고 동의를 받습니다.\r\n④ 회사는 개인위치정보를 이용자가 지정하는 제3자에게 제공할 경우, 개인위치정보를 수집한 당해 통신단말장치로 매회 이용자에게 제공받는 자, 제공일시 및 제공목적을 즉시 통보합니다. 단, 아래 각호 1에 해당하는 경우에는 이용자가 미리 특정하여 지정한 통신 단말장치 또는 전자우편주소로 통보합니다.\r\n1. 개인위치정보를 수집한 당해 통신단말장치가 문자, 음성 또는 영상의 수신기능을 갖추지 아니한 경우\r\n2. 이용자가 온라인 게시 등의 방법으로 통보할 것을 미리 요청한 경우\r\n제8조 개인위치정보주체의 권리\r\n① 개인위치정보주체는 회사에 대하여 언제든지 개인위치정보를 이용한 위치기반서비스 제공 및 개인위치정보의 제3자 제공에 대한 동의의 전부 또는 일부를 철회할 수 있습니다. 이 경우 회사는 수집한 개인위치정보 및 위치정보 이용, 제공사실 확인자료(동의의 일부를 철회한 경우에는 철회하는 부분의 확인자료)를 파기합니다.\r\n② 개인위치정보주체는 회사에 대하여 언제든지 개인위치정보의 수집, 이용 또는 제공의 일시적인 중지를 요구할 수 있습니다. 이 경우 회사는 이를 거절하지 아니하며, 이를 위한 기술적 조치를 취합니다.\r\n③ 개인위치정보주체는 회사에 대하여 아래 각 호의 자료에 대한 열람 또는 고지를 요구할 수 있고, 당해 자료에 오류가 있는 경우에는 그 정정을 요구할 수 있습니다. 이 경우 회사는 정당한 사유 없이 개인위치정보주체의 요구를 거절할 수 없습니다.\r\n1. 개인위치정보주체에 대한 위치정보 이용, 제공사실 확인자료\r\n2. 개인위치정부주체의 개인위치정보가 위치정보의 보호 및 이용 등에 관한 법률 또는 다른 법률 규정에 의하여 제3자에게 제공된 이유 및 내용\r\n제9조 적용 제외\r\n만 14세 미만 아동은 서비스 이용이 불가합니다. 회사는 만 14세 미만 아동의 위치정보를 수집하지 않으며, 14세 미만의 이용자에 대해서는 위치기반서비스와 관련한 민원 발생 등에 대해서는 책임을 지지 않습니다.\r\n제10조 회사의 주소 및 연락처 등\r\n① 회사의 상호, 주소 및 연락처\r\n상호 : swiftER\r\n\r\n대표: 홍길동\r\n\r\n주소 : 부산 남구 수영로 299 루미너스 빌딩 10층\r\n\r\n대표전화 : 1234-5678\r\n\r\n② 회사는 위치정보를 적절히 관리∙보호하고 개인위치정보주체의 불만을 원활히 처리할 수 있도록 실질적인 책임을 질 수 있는 자를 위치정보관리책임자로 지정해 운영합니다. 위치정보관리책임자의 성명과 연락처는 아래와 같습니다.\r\n성명 : 홍길동\r\n\r\n대표전화 : 1234-5678\r\n\r\n위치정보문의 : 웹사이트 > 고객센터 > FAQ > 회원/정보관리 > 문의하기\r\n\r\n제11조 서비스의 성격과 회사의 면책\r\n① 회사가 이용자에게 제공하는 서비스는 이용자가 자신의 위치를 기반으로 가까운 매장에 관한 정보를 게재 및 열람하고 이를 통하여 매장 방문과 관련하여 도움을 얻을 수 있도록 정보를 수집 및 게재하는 것에 국한합니다.\r\n② 회사가 위치정보의 보호 및 이용 등에 관한 법률 제15조 내지 제26조의 규정을 위반한 행위로 이용자에게 손해가 발생한 경우 이용자는 회사에 대하여 손해배상 청구를 할 수 있습니다. 이경우 회사는 고의, 과실이 없음을 입증하지 못하는 경우 책임을 면할 수 없습니다.\r\n③ 회사는 천재지변 또는 이에 준하는 불가항력, 정보통신설비의 보수점검, 교체 또는 고장, 통신의 두절 등으로 인하여 일시적 또는 종국적으로 서비스를 제공할 수 없는 경우, 서비스 제공에 관한 책임이 면제됩니다. 이 경우 회사는 한샘닷컴 초기 서비스화면에 게시하거나 기타의 방법으로 이용자에게 통지합니다.\r\n④ 회사는 이용자의 귀책사유로 인한 서비스 이용의 장애에 대하여 책임을 지지 않습니다.\r\n⑤ 회사는 회사 또는 다른 이용자가 게재한 정보, 자료, 사실의 정확성 및 신뢰성 등을 보증하지 않으며, 이를 신뢰함으로써 이용자 기타 제3자가 입은 손해에 대하여 책임을 지지 않습니다.\r\n제12조 분쟁의 조정 및 기타\r\n① 회사는 위치정보와 관련된 분쟁에 대해 당사자간 협의가 이루어지지 아니하거나 협의를 할수 없는 경우에는 위치정보의 보호 및 이용 등에 관한 법률 제28조의 규정에 의한 방송통신위원회에 재정을 신청할 수 있습니다.\r\n② 회사 또는 이용자는 위치정보와 관련된 분쟁에 대해 당사자간 협의가 이루어지지 아니하거나 협의를 할 수 없는 경우에는 개인정보보호법 제43조의 규정에 의한 개인정보분쟁조정위원회에 조정을 신청할 수 있습니다.\r\n부칙(2023. 3. 13.)\r\n제1조 (시행일) 이 약관은 2023년 3월 13일부터 시행한다.');
